import './App.css';
import Game from './components/Game';
import './assets/css/foundation.css';

function App() {
  return (
    <div className="App">
      <div className="grid-container">
        <div className="grid-x">
            <Game />
        </div>
      </div>
      <div className="bg"></div>
    </div>
  );
}

export default App;
